import React, { Component } from "react";
import { Button, Modal } from "react-materialize";
import Signup from "./Signup";
import Login from "./Login";


export default class ModalLoginFirst extends Component {
  render() {
    return (
      <div>
        <Modal header="Tienes que identificarte primero" fixedFooter trigger={<i class="material-icons">add</i>} actions={<Button waves="green" modal="close" flat>Cerrar</Button>}>
          <Signup></Signup>
          <Login></Login>
          <Button
            node="a"
            waves="light"
            className="blue"
            large
            style={{ marginRight: "5px" }}
          >   <a href={`${process.env.REACT_APP_API_URL}/auth/google`}>
          Google login
        </a></Button>
        <NavLink to="/create-bid" class="btn-floating btn-large waves-effect waves-light red"></NavLink>

        </Modal>
      </div>
    );
  }
}
